import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';

import UsersList from './pages/Users-list/Users-list'

function App() {
  return (
    <>
   <UsersList />
   <Switch>
   <Route path="/usuarios" exact render={() => <CoasterList />} />
   <Route path="/usuarios/:coaster_id" render={props => <CoasterDetails {...props} />} />
   <Route path="/crear" render={() => <CoasterForm />} />
 </Switch>
 </>
  );
}

export default App;
